import React from "react";
import "../css/Home.css"
import "../css/main.css"
import News from "./crawlRss";

function Home() {
    return(
      <div className={"container"}>
          <div className={"box-category"}>
              <div className={"box-category-top"}>
                  <h2 className="title-category">
                      Chính trị
                  </h2>
                  <div className="box-category-menu">
                      <a href="">Xem thêm</a>
                  </div>
              </div>
          </div>
          <div className="box-category-middle">
            <News url={"https://nld.com.vn/rss/home.rss"} quantity={7}></News>
          </div>
      </div>
    );
}

export default Home;
